import React from 'react'; import { FormControlHelper, FormControlHelperText, FormControlError, FormControlErrorIcon, FormControlErrorText, Radio, RadioGroup, RadioIcon, RadioIndicator, RadioLabel, Button, ButtonText, Checkbox, CheckboxGroup, CheckboxIndicator, CheckboxIcon, CheckboxLabel, Textarea, TextareaInput, Select, SelectTrigger, SelectInput, SelectIcon, SelectPortal, SelectBackdrop, SelectContent, SelectDragIndicatorWrapper, SelectDragIndicator, SelectItem, Slider, SliderTrack, SliderFilledTrack, SliderThumb, Switch, Modal, ModalBackdrop, ModalContent, ModalHeader, ModalCloseButton, ModalBody, ModalFooter, HStack, Heading, Center, Icon, CircleIcon, CheckIcon, AlertCircleIcon, ChevronDownIcon } from '@gluestack-ui/themed';


import { FormControl, Text, Image, FormControlLabel, FormControlLabelText, Input, InputField } from '@gluestack-ui/themed';
import { Box, VStack } from '@gluestack-ui/themed';


const RegisterView = () => {
    return <Box maxWidth="100%" width={"$full"} height="$1/3" borderRadius="$sm">
        <Image size="md" width={"$full"} height={"$full"} alt="login_image" source={require("/assets/pantalla_inicio.png")} resizeMode="cover" style={{
            alignSelf: "center"
        }} />
        <Text ml={"$5"} fontWeight='$bold' fontSize={"$2xl"} my={"$2"} color='black'>Register</Text>
        <VStack>
            <FormControl size={"md"} isDisabled={false} isRequired={false}>
                <FormControlLabel>
                    <FormControlLabelText color="black" ml="$5" fontSize={"$sm"} fontWeight='$bold'>Username</FormControlLabelText>
                </FormControlLabel>
                <Input width={"$3/4"} borderRadius={"$sm"} mx={"$auto"}>
                    <InputField type="password" defaultValue="" placeholder="Username" />
                </Input>
            </FormControl>
            <FormControl isInvalid={true} size={"md"} isDisabled={true} isRequired={true}>
                <FormControlLabel>
                    <FormControlLabelText>Password</FormControlLabelText>
                </FormControlLabel>
                <Input>
                    <InputField type="password" defaultValue="12345" placeholder="password" />
                </Input>
            </FormControl>
        </VStack>
    </Box>;
};
export default RegisterView;
